import {Link,Switch,Route} from 'react-router-dom';
import {useEffect, useState} from 'react';
import {useHistory} from "react-router-dom"
import Header from './header';
import Footer from './footer';
import Home from './home';
import Login from './login';
import DisplayPg from './displaypg';




export default function Launcher()
{
    var [user,setUser] = useState("");
    var history = useHistory();
    const [isLoggedIn, setIsLoggedIn] = useState(false);

    useEffect(()=>{
       var username = sessionStorage.getItem('username');
       if(username!=null && username!="")
       {
              setUser(username);
       } 
       else{
              setUser("Guest");
       }
    },[])

    const handleLogin = () => {
       setIsLoggedIn(!isLoggedIn);
     };

    return <>
            <hr></hr>
            <Header></Header>
            <hr></hr>
            <div style={{padding: 20}}>

              <nav class="navbar navbar-expand-lg bg-body-tertiary">
                     <div class="container-fluid">
                     <a class="navbar-brand" href="#">Unistay</a>
                     <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                     <span class="navbar-toggler-icon"></span>
                     </button>
                     <div class="collapse navbar-collapse" id="navbarNav">
                     <ul class="navbar-nav">
                            <li class="nav-item">
                            <a class="nav-link" href="/home">Home</a>
                            </li>
                            <li class="nav-item">
                            <a class="nav-link" href="/displaypg">DisplayPg</a>
                            </li>
                            <li class="nav-item">
                            <a class="nav-link" href="/addowner">AddOwner</a>
                            </li>
                            <li class="nav-item">
                            <a class="nav-link" href="/deleteowner">DeleteOwner</a>
                            </li>
                            <li class="nav-item" float="left">

                                   <Link to="/login">
                                          <button type="button" class="btn btn-success">Login</button>
                                   </Link>        
                            </li>
                     </ul>
                     </div>
                     </div>
                     </nav>

            </div>
            <hr></hr>
            <Switch>
                    <Route exact path='/home'
                           component={Home}></Route>        
                    <Route exact path='/login'
                            component={Login}></Route>
                     <Route exact path='/displaypg'
                            component={DisplayPg}></Route>

            </Switch>
            <hr></hr>
            <Footer></Footer>
            <hr></hr>
        </>
}
